import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="container" style={{ height: "100%" }}>
      <div className="row no-gutters">
        <div className="p-2 col-md-4" style={{ height: "200px" }}>
          <div className="pnl convex"></div>
        </div>
        <div className="col-md-4" style={{ height: "200px" }}>
          <div className="row no-gutters h-100">
            <div className="col-md-12 h-25 p-2">
              <div className="convex pnl"></div>
            </div>
            <div className="col-md-12 h-75 p-2">
              <div className="convex pnl"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
